import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';

import Header from './Header';
import Home from './Home/Home';

function Layout() {
  return (
    <>
      <Header />
      <div className='container'>
        <Router>
          <Routes>
            <Route exact path='/' element={<Home/>}/>
          </Routes>
        </Router>
      </div>
    </>
  )
}

export default Layout;
